text:
Milioni di persone fuggono da guerre e povertà e solo il 10% cerca approdo in Europa. Una sfida di questa portata può essere affrontata solo con un lavoro condiviso, improntato alla cooperazione e al rispetto iniziando fuori dai nostri confini
@FedericaMog
https://www.partitodemocratico.it/immigrazione/mogherini-ora-i-governi-investano-in-africa/

translation:
Millions of people flee war and poverty and only 10% seek refuge in Europe. A challenge of this magnitude can only be faced with shared work, based on cooperation and respect, starting outside our borders
@FedericaMog
https://www.partitodemocratico.it/economia/mogherini-ora-i-governi-investano-in-africa/

